import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.css'],
})
export class EventosComponent implements OnInit {
  /**
   * evento : any=  */
  public evento: any = [
    {
      Tema: 'Ayrton Senna',
      Local: 'São Paulo',
    },
    {
      Tema: 'Nelson Piquet',
      Local: 'Rio de Janeiro',
    },
    {
      Tema: 'Roberto Moreno',
      Local: 'Brasilia',
    },
  ];

  constructor() {}

  ngOnInit() {}
}
